import logo from './logo.svg';
import './App.css';
import Colors from './Colors.js';
import { TrackFeatures } from 'react-spotify-api'

<TrackFeatures id="4kmBkq3ONzENSIRv2ah8Gh">
    {(features, loading, error) => (
        features ? (
            <h1>{features.key}</h1>
        ) : null
    )}
</TrackFeatures>
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Colors></Colors>
      </header>
    </div>
  );
}

export default App;
